INSERT INTO public."MultiResponseQuestions"(
    "Id", "Text", "Items")
VALUES (-153, 'Kada dizajniramo softver, bitan cilj je da razdvojimo funkcionalnosti poslovne logike (npr. pravilo kako se stornira kupovina) od logike koja je vezana za tehnološke detalje (npr. kod za formiranje HTTP zahteva). Ovo pravilo važi i za sama imena, gde objekti i funkcije poslovne logike treba da sadrže samo reči koje potiču iz domena problema, odnosno od naših klijenata. Označi imena funkcija koje smatraš da potiču iz domena poslovne logike:', '[{{"Id":-1531,"Text":"string.join(\u0022:\", patientRecord)","IsCorrect":false,"Feedback":"Ovo nije ime iz domena problema već funkcija za spajanje elementa niza u string - tehnološki detalj."}},{{"Id":-1532,"Text":"Close(Account account)","IsCorrect":true,"Feedback":"Ovo ime je iz domena problema bankarskog poslovanja. Zatvaranje naloga je poslovna operacija koja se praktikovala i pre nego što su banke imale softver."}},{{"Id":-1533,"Text":"SaveToFile(MedicalHistory patientCard)","IsCorrect":false,"Feedback":"Ovo ime ističe tehnološki detalj - datoteku kao način perzistencije podataka. Da je ime metode bilo samo \u0022Save\u0022 mogli bismo ga svrstati u domen problema kao poslovnu želju da se trajno sačuva ova informacija. Međutim, poslovnu logiku ne zanima da li je to čuvanje u datoteci, bazi podataka ili na cloud-u."}},{{"Id":-1534,"Text":"RefreshEmployeeRegistryView()","IsCorrect":false,"Feedback":"Ovo ime je iz domena problema bankarskog poslovanja. Zatvaranje naloga je poslovna operacija koja se praktikovala i pre nego što su banke imale softver."}},{{"Id":-1535,"Text":"RegisterMember(Member newMember)","IsCorrect":true,"Feedback":"Po imenu možemo zaključiti da ova metoda osvežava neki prikaz (npr. tabele) što je tehnološki detalj."}}]');

